import { Route, Routes } from 'react-router-dom';
import './App.css';
import BaseLayout from './compoents/layout/BaseLayout';

function App() {
  return (
    <div className="container">
      <h1>My Shop</h1>
      <Routes>
        <Route path="/" element={<BaseLayout />}>

        </Route>
      </Routes>
    </div>
  );
}

export default App;
